import React from 'react';
import { ContainerTitle } from '../styles/contenedores';

const UserTitulo = (props) => {

    //console.log(props.match.params.table)
    const {name, url_image} = props.data



    return (
        <ContainerTitle>

            <section>
                <div>
                    <img src={url_image} alt="popadvise"/>
                </div>
            </section>

            <section>
                <h1>{name}</h1>
                <p>Mesa: {props.match.params.table}</p>
            </section>

        </ContainerTitle>
    );
};

export default UserTitulo;
